import React,{useState,useEffect} from 'react';
import {
  View,
  Text,
  Linking 
} from 'react-native';
import {runFireworks} from '..'
function Succsess() {

useEffect(()=>{
  localStorage.clear();

},[]);

  return (
    <View className="success-wrapper">
      <Text className="icon">
        Succuss
      </Text>
      <Text className="icon">
        Thank You for your order!
      </Text>
      <Text className="icon">
        If you have any questions, please email

      </Text>
      <Text style={{color: 'blue'}}
      onPress={() => Linking.openURL('mailto:ohadCo90@gmail.com')}>
    ohadCo90@gmail.com
</Text>
     
    </View>
  )
}

export default Succsess;
